import React, { Component } from 'react';

import "./style.css";
import Header from '../../components/Header';
import Hamburguer from '../../assets/images/hamburguer';
import Drawer from '../../components/SideMenu';
import Avaliacao from './components/Avaliacao';

class Avaliacoes extends Component {
    render = () => {
        return(
            <>
            <Header drawer={true} icon={<Hamburguer />} title={"Avaliações"}></Header>
            <Drawer></Drawer>
            <div className={"title-container"}>
                <p className={"title"}> Avaliações </p>
            </div>
            <Avaliacao></Avaliacao>
            <Avaliacao></Avaliacao>
            <Avaliacao></Avaliacao>
            <Avaliacao></Avaliacao>
            <Avaliacao></Avaliacao>
            </>
        )
    }

}

export default Avaliacoes;
